import {Component, OnInit} from '@angular/core';
import {DataService} from "../../services/data.service";
import {AuthService} from "../../services/auth.service";


@Component({
  selector: 'app-teams',
  templateUrl: './teams.component.html',
  styleUrls: ['./teams.component.css']
})
export class TeamsComponent implements OnInit {
  teams: any[] = [];
  newTeamData = {name:''}; // Data for creating a new team
  editTeamData: any = {}; // Data for editing a team
  selectedTeamId: string | null = null; // Store the ID of the selected team for editing

  constructor(public authService: AuthService,private dataService: DataService) {} // Inject DataService

  ngOnInit() {
    this.loadTeams();
  }

  loadTeams() {

  }

  //createTeam() {
    //this.dataService.createTeam(this.newTeamData).subscribe(() => {
    //  this.loadTeams(); // Reload the list of teams after creating one
    //  this.newTeamData = {name:''};
   // });
 // }

  editTeam(id: string) {
    this.selectedTeamId = id;
    this.dataService.getTeamById(id).subscribe((data: any) => {
      this.editTeamData = data;
    });
  }



  deleteTeam(id: string) {
    this.dataService.deleteTeam(id).subscribe(() => {
      this.loadTeams(); // Reload the list of teams after deleting one
    });
  }

  // Add more methods for adding/removing members or other functionality

  cancelEdit() {
    this.editTeamData = {}; // Clear the form
    this.selectedTeamId = null; // Reset the selected team
  }
}
<div class="container">
  <h2>Teams</h2>

  <!-- Create New Team Form -->
  <div class="mb-3">
    <h3>Create New Team</h3>
    <form >
      <div class="form-group">
        <label for="teamName">Team Name:</label>
        <input type="text" id="teamName" class="form-control" [(ngModel)]="newTeamData.name" name="name" required>
      </div>
      <button type="submit"  class="btn btn-primary">Create Team + {{authService.currentUser.userId}}</button>
    </form>
  </div>

  <!-- List of Teams -->
  <div class="mb-3">
    <h3>Teams</h3>
    <ul class="list-group">
      <li class="list-group-item" *ngFor="let team of teams">
        {{ team.name }}
        <button class="btn btn-primary btn-sm" (click)="editTeam(team._id)">Edit</button>
        <button class="btn btn-danger btn-sm" (click)="deleteTeam(team._id)">Delete</button>
      </li>
    </ul>
  </div>

  <!-- Edit Team Form -->
  <div class="mb-3" *ngIf="selectedTeamId !== null">
    <h3>Edit Team</h3>
    <form (ngSubmit)="updateTeam()">
      <div class="form-group">
        <label for="editTeamName">Team Name:</label>
        <input type="text" id="editTeamName" class="form-control" [(ngModel)]="editTeamData.name" name="name" required>
      </div>
      <button type="submit" class="btn btn-primary">Update Team</button>
      <button class="btn btn-secondary" (click)="cancelEdit()">Cancel</button>
    </form>
  </div>
</div>
